async function () {
  let filterVersion = {
    createDateStart: DateCreateStart.formattedDate,
    createDateEnd: DateCreateEnd.formattedDate,
    effectiveDateStart: DateEffectiveStart.formattedDate,
    effectiveDateEnd: DateEffectiveEnd.formattedDate
  };
  storeValue("filterVersion", filterVersion, false);
  PageControl.PreloadVersionList();
  showAlert('Filtering...', 'info');
  closeModal('ModalFilter');
}
